import React from 'react'

const actor = 'shyam'

const dancer = 'rajput'

function firstCom() {
  let name = 'ShyamRaj'
  return name
}

function SecondCom() {
  let name2 = 'ShyamRaj'
  return name2
}

export default actor
export { dancer, firstCom, SecondCom }

